import React, { useState } from "react";
import { Img, Text, Button } from "components";
import { useNavigate } from "react-router-dom";
import classNames from "classnames";

const LandingPageNavbar = (props) => {
  const navigate = useNavigate();
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const toggleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };

  return (
    <>
      <div
        className="flex flex-wrap items-center justify-between p-4 lg:p-6"
        style={{
          position: "fixed",
          top: 0,
          left: 0,
          right: 0,
          backgroundColor: "rgba(255, 255, 255, 0.96)",
        }}
      >
        <div
          className="flex items-center flex-shrink-0 mr-6"
          onClick={() => navigate("/")}
          style={{ marginLeft: "5px" }}
        >
          <Img
            src="images/img_image1.png"
            className="h-9 md:h-auto object-cover w-[37px]"
            alt="imageOne"
          />
          <Text
            className="font-helveticaneue text-black_900 text-center w-auto"
            as="h6"
            variant="h6"
          >
            {props?.waffle}
          </Text>
        </div>
        <div
          className="lg:hidden ml-4 cursor-pointer"
          onClick={toggleMobileMenu}
        >
          <i className={isMobileMenuOpen ? "fas fa-times" : "fas fa-bars"}></i>
        </div>
        <div
          className={classNames("nav-items-container lg:flex", {
            hidden: !isMobileMenuOpen,
            flex: isMobileMenuOpen,
          })}
        >
          <div
            className="block lg:inline-block lg:mt-0 text-black hover:text-black mr-4"
            onClick={() => navigate("/#product")}
          >
            {props?.product}
          </div>
          <div
            className="block lg:inline-block lg:mt-0 text-black hover:text-black mr-4"
            onClick={() => navigate("/newsfeed")}
          >
            {props?.readnews}
          </div>
          <Button
            className="block lg:inline-block lg:mt-0 text-black_900 text-center w-auto lg:mr-10"
            onClick={() => navigate("/waitlist")}
            shape="RoundedBorder10"
            size="md"
            variant="FillOrangeA100"
            style={{ marginRight: "5px" }}
          >
            {props?.joinWaitlist}
          </Button>
        </div>
      </div>
    </>
  );
};

LandingPageNavbar.defaultProps = {
  waffle: "Waffle.",
  product: "Product",
  readnews: "Read News",
  joinWaitlist: "Join waitlist",
};

export default LandingPageNavbar;
